import React from "react";

function DeleteButton() {
  return (
    <button
      style={{
        backgroundColor: "transparent",
        border: "none",
      }}
    >
      <i class="fas fa-play mr-2"></i>Delete
    </button>
  );
}

export default DeleteButton;
